INSERT INTO `article_metadata` VALUES (19633656,'Obesity is accompanied by chronic, low-grade inflammation of adipose tissue, which promotes insulin resistance and type-2 diabetes. These findings raise the question of how fat inflammation can escape the powerful armamentarium of cells and molecules normally responsible for guarding against a runaway immune response. CD4(+) Foxp3(+) T regulatory (T(reg)) cells with a unique phenotype were highly enriched in the abdominal fat of normal mice, but their numbers were strikingly and specifically reduced at this site in insulin-resistant models of obesity. Loss-of-function and gain-of-function experiments revealed that these T(reg) cells influenced the inflammatory state of adipose tissue and, thus, insulin resistance. Cytokines differentially synthesized by fat-resident regulatory and conventional T cells directly affected the synthesis of inflammatory mediators and glucose uptake by cultured adipocytes. These observations suggest that harnessing the anti-inflammatory properties of T(reg) cells to inhibit elements of the metabolic syndrome may have therapeutic potential.','Feuerer Markus, Herrero Laura, Cipolletta Daniela, Naaz Afia, Wong Jamie, Nayer Ali, Lee Jongsoon, Goldfine Allison B, Benoist Christophe, Shoelson Steven, Mathis Diane','Lean, but not obese, fat is enriched for a unique population of regulatory T cells that affect metabolic parameters.'),(20569070,'The host immune response can impact cancer growth, prognosis, and response to therapy. In colorectal cancer, the presence of cells involved with T-cell-mediated adaptive immunity predicts survival better than the current staging method. We used the expression of genes recently associated with host immune responses (T(H1)-mediated adaptive immunity, inflammation, and immune suppression) to perform hierarchical clustering of multiple large cohorts of cancer specimens to determine if immune-related gene expression resulted in clinical significant groupings of tumors. Microarray data from prostate cancer (n = 79), breast cancer (n = 132), lung cancer (n = 84), glioblastoma multiforme (n = 120), and lymphoma (n = 127) were analyzed. Among adenocarcinomas, the T(H1)-mediated adaptive immunity genes were consistently associated with better prognosis, while genes associated with inflammation and immune suppression were variably associated with outcome. Specifically, increased expression of the T(H1)-mediated adaptive immunity genes was associated with good prognosis in breast cancer patients under 45 years of age (p = .04, hazard ratio [HR] = 0.42) and in prostate cancer patients (p = .03, HR = 0.36) but not in lung cancer patients (p = 0.45, HR = 1.37). In lymphoma, patients with increased expression of inflammation and immune suppression genes had better prognosis than those expressing the T(H1)-mediated adaptive immunity genes (p = .01, HR = 0.43) and in glioblastoma multiforme, the expression of inflammation genes conferred improved prognosis than those expressing immune suppression genes (p = 0.05, HR = 0.62). In aggregate, the gene expression signatures implicating specific components of the immune response hold prognostic import across solid tumors.','Hsu David S, Kim Mickey K, Balakumaran Bala S, Acharya Chaitanya R, Anders Carey K, Clay Tim, Lyerly H Kim, Drake Charles G, Morse Michael A, Febbo Phillip G','Immune signatures predict prognosis in localized cancer.'),(23023392,'We assessed gene expression in tissue macrophages from various mouse organs. The diversity in gene expression among different populations of macrophages was considerable. Only a few hundred mRNA transcripts were selectively expressed by macrophages rather than dendritic cells, and many of these were not present in all macrophages. Nonetheless, well-characterized surface markers, including MerTK and FcγR1 (CD64), along with a cluster of previously unidentified transcripts, were distinctly and universally associated with mature tissue macrophages. TCEF3, C/EBP-α, Bach1 and CREG-1 were among the transcriptional regulators predicted to regulate these core macrophage-associated genes. The mRNA encoding other transcription factors, such as Gata6, was associated with single macrophage populations. We further identified how these transcripts and the proteins they encode facilitated distinguishing macrophages from dendritic cells.','Gautier Emmanuel L, Shay Tal, Miller Jennifer, Greter Melanie, Jakubzick Claudia, Ivanov Stoyan, Helft Julie, Chow Andrew, Elpek Kutlu G, Gordonov Simon, Mazloom Amin R, Ma\'ayan Avi, Chua Wei-Jen, Hansen Ted H, Turley Shannon J, Merad Miriam, Randolph Gwendalyn J','Gene-expression profiles and transcriptional regulatory pathways that underlie the identity and diversity of mouse tissue macrophages.'),(30127393,'Cancer treatment by immune checkpoint blockade (ICB) can bring long-lasting clinical benefits, but only a fraction of patients respond to treatment. To predict ICB response, we developed TIDE, a computational method to model two primary mechanisms of tumor immune evasion: the induction of T cell dysfunction in tumors with high infiltration of cytotoxic T lymphocytes (CTL) and the prevention of T cell infiltration in tumors with low CTL level. We identified signatures of T cell dysfunction from large tumor cohorts by testing how the expression of each gene in tumors interacts with the CTL infiltration level to influence patient survival. We also modeled factors that exclude T cell infiltration into tumors using expression signatures from immunosuppressive cells. Using this framework and pre-treatment RNA-Seq or NanoString tumor expression profiles, TIDE predicted the outcome of melanoma patients treated with first-line anti-PD1 or anti-CTLA4 more accurately than other biomarkers such as PD-L1 level and mutation load. TIDE also revealed new candidate ICB resistance regulators, such as SERPINB9, demonstrating utility for immunotherapy research.','Jiang Peng, Gu Shengqing, Pan Deng, Fu Jingxin, Sahu Avinash, Hu Xihao, Li Ziyi, Traugh Nicole, Bu Xia, Li Bo, Liu Jun, Freeman Gordon J, Brown Myles A, Wucherpfennig Kai W, Liu X Shirley','Signatures of T cell dysfunction and exclusion predict cancer immunotherapy response.');
